import React from 'react'
import { Button, Nav } from 'react-bootstrap';

const Home = () => {

  return (
    <div>
        <Nav fill variant="tabs" defaultActiveKey="/home">
            <Nav.Item>
                <Nav.Link href="/home">Active</Nav.Link>
            </Nav.Item>
        </Nav>

    </div>
  )
}

export default Home
